import React from 'react';
import { Wrapper, Status } from "@googlemaps/react-wrapper";

const render = (status) => {
  if (status === Status.LOADING) return <p>Загрузка карты...</p>;
  if (status === Status.FAILURE) return <p>Ошибка загрузки карты</p>;
  return null;
};

function MyMapComponent() {
  const mapRef = React.useRef(null);

  React.useEffect(() => {
    if (mapRef.current) {
      // Инициализация карты
      new window.google.maps.Map(mapRef.current, {
        center: { lat: 59.9342802, lng: 30.3350986 }, // Координаты Санкт-Петербурга
        zoom: 12,
      });
    }
  }, []);

  return <div ref={mapRef} style={{ height: "358px", width: "100%" }} />;
}

export default function Map() {
  return (
    <>
      <div className="container">
        <div className="section-map__title">
          <h2 className="title-2" id="map">Район на карте</h2>
        </div>
        <div className="section-map__map">
          <Wrapper apiKey="YOUR_GOOGLE_MAPS_API_KEY" render={render}>
            <MyMapComponent />
          </Wrapper>
        </div>
      </div>
    </>
  );
}
